export class Usuario {

    id_usuario: number = 0;
    nombre: string = "";
    correoElectronico: string = "";
    contrasena: string = "";
    tipoUsuario: number = 0;
    apellidoP: string = "hola";
    apellidoM: string = "";
    telefono: string = "";
    estatusUsuario: boolean = false;
    rutaImagenPerfil: string = "";
    rutaImagenPortada: string  = "";

}
